import { useState, useEffect } from 'react';
import './App.css';

function VideoArray() {
  const [data, setData] = useState(null);
  var arr = [];
  var first;

  useEffect(() => {
    fetch("/videos")
      .then((res) => res.json())
      .then((data) => setData(data.message))
  }, []);

  arr = data.split(",");
  let icons = "<ul>";
  arr.forEach(myFunction);
  icons += "</ul>";

  function myFunction(value) {
    icons += "<li>" + value + "</li>";
  }
  return (
      <div>{arr}</div>
  );
}

function App() {
  const [data, setData] = useState(null);

  useEffect(() => {
    // fetch with parameters is working yay... find a way to use this to get a specific file in a folder, also utilizing serve-index
    fetch("/api/123")
      .then((res) => res.json())
      .then((data) => setData(data.message));
  }, []);


  return (
    <div className="App">
     <p>{!data ? "Loading..." : data}</p>
     <VideoArray />
    </div>
  );
}

export default App;
